column224:
Tannhelsesenteret Sogndal er en spesialistklinikk med moderne lokaler og utstyr i sentrum av Sogndal. Klinikken er en avdeling av Tannhelsesenteret L&oslash;renskog AS. Klinikken har spesialister i kjeveortopedi, kirurgi, endodonti, periodonti, protetikk og behandling av snorking og s&oslash;vnapn&eacute;.
Vi s&oslash;ker tannpleier.
